import { StyleSheet } from "react-native"

export const styles = StyleSheet.create({
    container: {
        flex: 0.4,
        backgroundColor: "#C9D6D0",

    },
    container2: {
        flex: 1,
        backgroundColor: "#C9D6D0",
        alignItems: 'center',
    },
    imagemCoruja: {
        justifyContent: 'center',
        width: 80,
        height: 80,
        borderRadius: 150,
        marginVertical: 70,
        // marginHorizontal: 145,

    },
    botao: {
        alignItems: 'center',
        justifyContent: "center",
        width: 250,
        height: 50,
        backgroundColor: "#F5FEFE",
        borderRadius: 20,
        paddingLeft: 10,
        margin: 15,
    }
})
